Let me think through this step by step...

The key psychological mechanisms involved in responder behavior in this ultimatum game are fairness and self-interest.  Responders don't just consider the absolute amount offered; they also evaluate the offer's fairness relative to the total earnings and their own contribution.  A simple model could capture this by considering the percentage of the combined earnings offered to the responder, weighting this percentage by the relative contributions of each player.  A higher weight on relative contributions would reflect a stronger sense of fairness.

How these mechanisms interact: The responder's utility increases with the amount offered (self-interest) but also with the perceived fairness of the split.  A very unfair offer (even if large in absolute terms) might be rejected because the perceived unfairness outweighs the monetary gain.

What mathematical form could capture these interactions: A linear model could represent the interaction, where the utility is a weighted sum of the absolute amount offered and a fairness term. The fairness term can be calculated based on the ratio of the proposed share to the combined earnings, adjusted by the ratio of the responder's contribution to the opponent's contribution.

What parameters would be needed to calibrate the model: The model would need two parameters: one representing the weight given to self-interest (the absolute amount), and another representing the weight given to fairness (the fairness term).

How the model variables map to observable behavior:  A higher weight on self-interest would lead to more acceptances of even slightly unfair offers.  A higher weight on fairness would lead to more rejections of unfair offers, even if the absolute amount is substantial.  The model’s predictions would reflect these trade-offs, indicating the utility of accepting a specific offer.


